import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import ButtonAppBar from '../components/buttonAppBar';
import { withStyles, responsiveFontSizes } from '@material-ui/core/styles';
import { Button, Backdrop, AppBar, Box, Container } from '@material-ui/core';
import SimpleCard from '../components/userInfo'
import Feed from '../components/feed'
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    maxWidth: '80%'
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

const StyledBoxBlue = withStyles({
    root: {
      background: '#a4d8ef',
      width: '100%',
      minWidth: '100%',
      height: '600px',
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      marginLeft: '0px',
      color: "white",
      fontSize: "60px",
      fontFamily: "Arial, Helvetica, sans-serif"
    },
  })(Box);

  const StyledBoxWhite = withStyles({
    root: {
      background: '#FFFFFF',
      width: '100%',
      minWidth:'100%',
      height: '100%',
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      marginLeft: '0px',
      color: "white",
      fontSize: "60px",
      fontFamily: "Arial, Helvetica, sans-serif"
    },
  })(Box);

export default function CenteredGrid() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={7}>
          <SimpleCard />
        </Grid>
        <Grid item xs={2}>
          <Card style={{ textAlign: 'center' }}>
            <h3 style={{ fontSize: '50px' }}>500$</h3>
            <p style={{ fontSize: '20px' }}>Money Raised</p>
          </Card>
        </Grid>
        <Grid item xs={2}>
          <Card style={{ textAlign: 'center' }}>
            <h3 style={{ fontSize: '50px' }}>50$</h3>
            <p style={{ fontSize: '20px' }}>Money Donated</p>
          </Card>
        </Grid>
        <Grid item xs={7}>
          <Feed/>
        </Grid>
        <Grid item xs={4}>
          <Card>
            <h3 ></h3>
          </Card>
        </Grid>
      </Grid>
    </div>
  );
}
